(9, 'Непонятная вакансия', 'United Tech , Киев', 'Yana Yastrebinska', '', '', 'Middle/Senior Product Data Analyst', 'About the product: Our platform helps discover new people, communicate without borders worldwide, create communities, and share interesting content. It also includes video chats, interactive elements, internal currency and unique gifts.\r\n\r\nAbout your key responsibilities and impact:\r\n\r\nFinding data patterns and dependencies between data and metrics\r\nProvide analytical support to our product and marketing teams\r\nCreate reports and analyze product metrics (LTV, churn rate, cohorts, retention, a-ha moment, etc.)\r\nResearch and conclude on results of A/B tests and provide insights for improvement\r\nAutomate reporting process and create dashboards for different stakeholders\r\nOperational monitoring of key metrics and determining the causes of deviations from the expected values\r\n\r\nAbout you:\r\n\r\n2+ years of experience working as a Product or Data Analyst\r\nFull proficiency in SQL\r\nFull proficiency with data visualization tools (Data Studio, Tableau, Power BI, Apache Superset, Qlik, etc.)\r\nSolid knowledge of key product metrics, experience in building funnels and making recommendations based on them\r\nKnowledge of statistics fundamentals and experimental design. Understanding of both statistics and regression methods\r\nExperience with A/B and Multivariate testing techniques and measurements\r\nExperience in delivering analytical solutions for complex product-related tasks (user pattern research, supporting experiments, feature analysis to improve product metrics, use-cases analysis, etc.)\r\nAt least Intermediate level of English is a must\r\n\r\nWill be a plus if it is also about you:\r\n\r\nKnowledge of Python or R\r\nFull proficiency in Tableau\r\nExperience in creating prediction models, segmentation\r\nExperience with mobile applications\r\n\r\nWhat we offer:\r\n\r\nComfortable working environment. You can work at our comfortable hub in Kyiv or remotely anywhere with a flexible schedule. We reimburse expenses for renting workspaces in other cities. Also, you can get financial and legal support, modern equipment, and up-to-date tools.\r\nHighly-skilled team. We have several independent products and cross-functional autonomous teams with Tech leads. The seniority level of the team is Middle&amp;Senior, so you will get the option to share practical cases and knowledge with experts in the social networking niche\r\nPersonal impact and ambitious goals. Our products are in top positions in their categories on App Store and Google Play. We&rsquo;re free to implement our ideas and directly influence products, cherishing our users. So you can make your direct impact on fast-growing products with a multi-million audience\r\nInvestment in the future. The growth of our teammates is boosted with performance-oriented reviews, IDPs, free English classes, reimbursement of professional development courses, constructive feedback, international projects, a corporate library, and knowledge sharing\r\nCare and support. We maintain a human-to-human approach and care for our teammates&#039; safety, health, and rest with 20 paid vacation days, 15 days of paid sick leave,100% coverage of medical insurance, reimbursement for sports and equipment, corporate events, stylish merch, and relocation options\r\n\r\n', 'linkedin', '', '2023-04-03 13:07:08', '2023-04-28 01:41:18', 1, 0, ''),
(10, 'Codegenix уже работал', 'Codegenix', '', 'contact@codegenix.io', '', 'Отослал резюме Developer', 'Отослал резюме Developer', 'other', 'https&colon;&sol;&sol;www&period;codegenix&period;io&sol;about', '2023-04-04 15:58:34', '2023-04-19 22:04:21', 0, 0, ''),
(11, 'Tibco ', 'srastaffing.com - staff', 'anusha https://www.linkedin.com/in/anusha-s-32b4009a/', '', '', 'Senior Integration Developer performing TIBCO Dev&amp;Admin', 'Senior Integration Developer performing TIBCO Dev&amp;Admin\r\nDear Vitalii,\r\n\r\nHope you are doing good.\r\n\r\nStart Date: 04/11/2023\r\nEnd Date: 03/31/2024\r\n\r\nMandatory Education/Certifications:\r\n&bull; A degree in computer science, software engineering or related discipline or an equivalent mix of education and experience\r\n&bull; Formal TIBCO training on the following:\r\n- Business Works Server (BW)\r\n- Enterprise Message Server (EMS)\r\nMandatory Experience::\r\n&bull; Proven experience developing services with TIBCO version 6\r\n&bull; Proven experience developing applications with Java and Web Service development (HTTP, HTTPS, JMS, JSON, Restful Service, SOAP)\r\n&bull; Proven experience working with certificates and SSL\r\n&bull; Understanding and experience with SOA concepts.\r\n&bull; Proven experience working in an enterprise envrionment utilizing proper IT processes:\r\n- SDLC\r\n- Change Control\r\n- Incident Management\r\n- etc.\r\n&bull; Familiar with different database tools, such as ORACLE, SQL Server, My SQL, Access, and database languages, such as SQL, PL/SQL, XML, and SQL store procedures (transact SQL)\r\n&bull; Proven experience with data analysis\r\n&bull; Good customer service skills and attitude\r\n&bull; Has the ability to work with a team as well as independently to complete deliverables within established timeline\r\n&bull; Possess significant analytical experience and problem solving ability\r\n&bull; Is able to function within a high level of activity (working with deadlines on several concurrent initiatives)\r\n\r\nAnusha Talla\r\nTechnical Recruiter at SRA Staffing\r\nanushas@srastaffing.com\r\nPh No : 416-296-1772 ext 2033\r\n', 'other', '&Pcy;&iecy;&rcy;&iecy;&pcy;&icy;&scy;&kcy;&acy; &vcy; Linkedin', '2023-04-19 16:21:51', '2023-04-19 22:17:40', 0, 0, ''),
(12, 'Нашёл описание стека вакансий', 'Intact', 'Glassdoor saved', '', '', 'Backend Java Developer (Senior/Intermediate)', 'Our stack :\r\nArchitecture: Micro-services &ndash; Micro-frontends\r\nWeb: Kotlin &ndash; Java &ndash; Spring Boot &ndash; Spring Cloud &ndash; MongoDB &ndash; Redis\r\nTools: GitHub &ndash; JIRA &ndash; Confluence &ndash; Teams &ndash; IntelliJ &ndash; Postman &ndash; Maven - Jenkins\r\nCI/CD: Jenkins &ndash; Veracode &ndash; SonarQube &ndash; Prisma Cloud &ndash; Argo CD\r\nHosting: Docker - Kubernetes &ndash; OCP &ndash; Elastic Search / Logstash / Kibana\r\n\r\n\r\nFrom coast-to-coast, our inspiring colleagues are at the heart of what we do best: helping people, businesses and society prosper in good times and be resilient in bad times. With our team, you&rsquo;ll bring this purpose to life every day by living our Values, being open to change, and pursuing your goals.\r\n\r\nIn return, we&rsquo;ll give you countless opportunities to learn and grow, alongside a diverse and passionate community of experts &ndash; the best the industry has to offer. You&rsquo;ll be empowered to be your best self, do your best work, and make a meaningful impact. Here, you can help shape the future of insurance, win as a team, and grow with us.\r\n\r\nAbout the role\r\n\r\nAt Intact we&rsquo;ll give you countless opportunities to learn and grow, alongside a diverse and passionate community of experts &ndash; the best the industry has to offer. You&rsquo;ll be empowered to be your best self, do your best work, and make a meaningful impact. Here, you can: shape the future of insurance, win as a team, and grow with us.\r\n\r\nAlongside a multidisciplinary team in a high-performance environment that promotes autonomy, you will work to solve complex problems and challenges and execute fresh ideas to help push the needle forward and meet the evolving needs of our customers.\r\n\r\nWhat you&rsquo;ll do here :\r\n\r\nParticipate in the development of major systems using new web and application technologies\r\n\r\nImprove and/or develop functionalities to meet the needs of users by designing solutions, solving problems, producing estimates of the work to be done and by programming, testing, debugging and documenting work\r\n\r\nDevelop/support web applications and Java services in Agile mode\r\n\r\nBe part of the developer&rsquo;s community, participating in the continuous improvement and best practices\r\n\r\nParticipate in brainstorming to find technical solutions with other team members, making prototypes, as needed\r\n\r\nNeed to interact on a regular basis with colleagues across the country\r\n\r\nWhat you bring to the table :\r\n\r\nGood knowledge of Java and/or Kotlin (Springboot)\r\n\r\nAn Agile/Scrum/Safe and DevOps mindset.\r\n\r\nWhat we are looking for :\r\n\r\n\r\nIf you have 3+ years experience as a developer, we are interested in meeting with you and finding out what you could bring to our team! We are looking for motivated, curious and resourceful people, ready to contribute and receive feedback and concerned about quality.\r\n\r\nOur stack :\r\n\r\nArchitecture: Micro-services &ndash; Micro-frontends\r\n\r\nWeb: Kotlin &ndash; Java &ndash; Spring Boot &ndash; Spring Cloud &ndash; MongoDB &ndash; Redis\r\n\r\nTools: GitHub &ndash; JIRA &ndash; Confluence &ndash; Teams &ndash; IntelliJ &ndash; Postman &ndash; Maven - Jenkins\r\n\r\nCI/CD: Jenkins &ndash; Veracode &ndash; SonarQube &ndash; Prisma Cloud &ndash; Argo CD\r\n\r\nHosting: Docker - Kubernetes &ndash; OCP &ndash; Elastic Search / Logstash / Kibana\r\n\r\n\r\nRecruitment process :\r\nWe strive to make our recruitment process efficient and light.\r\n\r\n30 min call with our HR Talent acquisition expert.\r\n\r\n1h behavioural and technical interview with your future Software Development Manager and your Tech Lead.\r\n\r\nBackground check.\r\n\r\nOffer!\r\n\r\n\r\n#LI-Hybrid #LI-IT\r\n\r\nWhat we offer\r\n\r\nWorking here means you&#039;ll be empowered to be and do your best every day. Here is some of what you can expect as a permanent member of our team:\r\n\r\nA financial rewards program that recognizes your success\r\n\r\nAn industry leading Employee Share Purchase Plan; we match 50% of net shares purchased\r\n\r\nAn extensive flex pension and benefits package, with access to virtual healthcare\r\n\r\nFlexible work arrangements\r\n\r\nPossibility to purchase up to 5 extra days off per year\r\n\r\nAn annual wellness account that promotes an active and healthy lifestyle\r\n\r\nAccess to tools and resources to support physical and mental health, embracing change and connecting with colleagues\r\n\r\nA dynamic workplace learning ecosystem complete with learning journeys, interactive online content, and inspiring programs\r\n\r\nInclusive employee-led networks to educate, inspire, amplify voices, build relationships and provide development opportunities\r\n\r\nInspiring leaders and colleagues who will lift you up and help you grow\r\n\r\nA Community Impact program, because what you care about is a part of what makes you different. And how you contribute to your community should be just as unique.\r\n\r\nWe are an equal opportunity employer\r\n\r\nAt Intact, we value diversity and strive to create an inclusive, accessible workplace where all individuals feel valued, respected, and heard.\r\n\r\nIf we can provide a specific adjustment to make the recruitment process more accessible for you, please let us know when we reach out about a job opportunity. We&rsquo;ll work with you to meet your needs.\r\n\r\nClick here to review other important information about the hiring process, including background checks, internal candidates, and eligibility to work in Canada.\r\n\r\nIf you are an employee of Intact, belairdirect, or Johnson Insurance, please apply for this role on Contact People.\r\n', 'glasdoor', 'https&colon;&sol;&sol;www&period;intactfc&period;com&sol;', '2023-04-19 17:34:47', '2023-04-19 23:14:32', 0, 0, ''),
(19, '5 - на сайте https://jobs.jobvite.com/', 'Cognizant', 'http://www.cognizant.com/', '', '', 'Lead SQL Developer (Remote)', 'https://jobs.jobvite.com/tylertech/job/o97Lkfw5/applyConfirmation\r\nWe are Cognizant Artificial Intelligence\r\n\r\nDigital technologies, including analytics and AI, give companies a once-in-a-generation opportunity to perform orders of magnitude better than ever before. But clients need new business models built from analyzing customers and business operations at every angle to really understand them.\r\n\r\nWith the power to apply artificial intelligence and data science to business decisions via enterprise data management solutions, we help leading companies prototype, refine, validate, and scale the most desirable products and delivery models to enterprise scale within weeks\r\n\r\n*You must be legally authorized to work in the United States/Canada without the need for employer sponsorship, now or at any time in the future *\r\n\r\nJob Title: Lead SQL Developer\r\n\r\nResponsibilities:\r\n\r\nDevelop, design, test and implement complex database programs using Oracle and third-party tools.\r\nExperience with Oracle Version 10g, 11g, 12c.\r\nStrong experience with oracle functions, procedures, triggers, packages &amp; performance tuning.\r\nHands on development using Oracle PL/SQL.\r\nStrong experience in Data Analysis, Modeling and Design of complex data flows/maps.\r\nExperience with DB &amp; ETL Development tools like PL/SQL, Informatica.\r\nQualifications\r\n\r\nBachelor&rsquo;s degree in a relevant field, such as Information Technology, Business, Communications, Finance, Logistics, Marketing, Engineering, or equivalent.\r\n5+ years of experience in Oracle PL/SQL.\r\n#LI-EV1 #CB #Ind123\r\n\r\nEmployee Status : Full Time Employee\r\n\r\nShift : Day Job\r\n\r\nTravel : No\r\n\r\nJob Posting : Apr 03 2023\r\n\r\nAbout Cognizant\r\nCognizant (Nasdaq-100: CTSH) is one of the world&#039;s leading professional services companies, transforming clients&#039; business, operating and technology models for the digital era. Our unique industry-based, consultative approach helps clients envision, build and run more innovative and efficient businesses. Headquartered in the U.S., Cognizant is ranked 185 on the Fortune 500 and is consistently listed among the most admired companies in the world. Learn how Cognizant helps clients lead with digital at www.cognizant.com or follow us @Cognizant.', 'indeed', '&Ncy;&acy; &scy;&acy;&jcy;&tcy;&iecy; &Gcy;&lcy;&acy;&scy;&dcy;&ocy;&rcy;', '2023-04-19 23:18:54', '2023-04-20 02:05:22', 0, 0, ''),
(20, 'https://www.tylertech.com/careers/job-openings', 'Tyler tech', 'Tyler', '', '', 'Вакансии на сайте', 'https://www.tylertech.com/careers/job-openings\r\nПросмотреть вакансии на сайте', 'tylertech', 'https&colon;&sol;&sol;www&period;tylertech&period;com&sol;careers&sol;job-openings', '2023-04-20 02:08:22', '2023-04-20 02:08:22', 0, 0, ''),
(21, 'Подался на сайте', 'cognizant', 'C', '', '', 'Lead SQL Developer (Remote) (00053813882)', 'Lead SQL Developer (Remote) (00053813882) https://careers.cognizant.com/ca/en/applythankyou?jobSeqNo=COGNGLOBAL00053813882&amp;status=alreadyApplied&amp;jobId=00053813882&amp;jobTitle=Lead%20SQL%20Developer%20(Remote)', 'Cognizant', 'https&colon;&sol;&sol;careers&period;cognizant&period;com&sol;ca&sol;en&sol;job&sol;00053813882&sol;Lead-SQL-Developer-Remote', '2023-04-20 02:26:36', '2023-04-20 02:26:36', 0, 0, ''),
(22, 'Подался на сайте', 'Cognizant Technology Solutions', 'Pallavi Tatooskar Cell: 732-306-4065', 'pallavi.tatooskar@cognizant.com', '', 'Talend Developer (Remote)', 'Прошёл собеседование понедельник 25 апреля.\r\nWe are Cognizant Artificial Intelligence\r\n\r\nDigital technologies, including analytics and AI, give companies a once-in-a-generation opportunity to perform orders of magnitude better than ever before. But clients need new business models built from analyzing customers and business operations at every angle to really understand them.\r\n\r\nWith the power to apply artificial intelligence and data science to business decisions via enterprise data management solutions, we help leading companies prototype, refine, validate, and scale the most desirable products and delivery models to enterprise scale within weeks\r\n\r\n*You must be legally authorized to work in the United States/Canada without the need for employer sponsorship, now or at any time in the future *\r\n\r\nJob Title:  Talend Developer\r\n\r\nResponsibilities:\r\n\r\nAssociate should have excellent Talend process knowledge\r\nAssociate should have minimum of 4+ years of Talend\r\nhands-on experience\r\nAssociate should own the deliverables specific to Talend jobs failures and deployment changes\r\nAssociate should be experienced in setting up Talend environment\r\nAssociate should act as an escalation POC for Talend batch related support activities\r\nAssociate should have knowledge on Oracle\r\nAssociate should have knowledge on Unix\r\nAssociate has to interact with customer on daily basis and provide updates on the data\r\nRequired Skills:\r\n\r\nTALEND ETL \r\nSQL Developer \r\nShell scripting\r\n#LI-EV1 #CB #Ind123\r\n\r\nEmployee Status : Full Time Employee\r\n\r\nShift : Day Job\r\n\r\nTravel : No\r\n\r\nJob Posting : Apr 03 2023\r\n\r\nAbout Cognizant\r\n\r\nCognizant (Nasdaq-100: CTSH) is one of the world&#039;s leading professional services companies, transforming clients&#039; business, operating and technology models for the digital era. Our unique industry-based, consultative approach helps clients envision, build and run more innovative and efficient businesses. Headquartered in the U.S., Cognizant is ranked 185 on the Fortune 500 and is consistently listed among the most admired companies in the world. Learn how Cognizant helps clients lead with digital at www.cognizant.com or follow us @Cognizant.', 'Cognizant', 'https&colon;&sol;&sol;careers&period;cognizant&period;com&sol;ca&sol;en&sol;job&sol;00053813861&sol;Talend-Developer-Remote', '2023-04-20 03:13:58', '2023-04-25 01:33:46', 0, 0, ''),
(23, 'Просмотрел не подавался', 'Cognizant Technology Solutions', 'С', '', '', 'ETL Automation Test Engineer.', 'Cognizant has an immediate opening for ETL Automation Test Engineer.\r\n\r\nNote: Candidate must be comfortable working in hybrid mode (report in person to the Toronto downtown office 3 days a week).\r\n\r\n \r\n\r\nJob Description:\r\n\r\nMinimum 6+ years of Quality Assurance Analyst experience.\r\nMust have 2+ years of hands-on exp. In ETL data testing.\r\nMust have good hands on automation experience using either Java/Python, Selenium or ROBOT framework.\r\nGood experience in SQL having written complex queries.\r\nStrong back-end SQL and back end testing experience.\r\nExperience in automating test environments and test data generation.\r\nExperience with Git.\r\nExposure to Jenkins\r\nCommunication skills should be good as this is a new program where person will have to interact with multiple stake holders.\r\nWorking exp with Agile methodology.\r\n', 'Cognizat', 'https&colon;&sol;&sol;careers&period;cognizant&period;com&sol;ca&sol;en&sol;job&sol;00053836812&sol;ETL-Automation-Test-Engineer', '2023-04-20 03:21:59', '2023-04-20 03:21:59', 0, 0, ''),
(24, 'Не подавался странная в', 'Cognizant Technology Solutions', 'С', '', '', 'Data Modeler (Remote)', 'This is a remote position open to any qualified applicant in Canada and The United States.\r\n\r\nWe are Cognizant Artificial Intelligence\r\n\r\nDigital technologies, including analytics and AI, give companies a once-in-a-generation opportunity to perform orders of magnitude better than ever before. However, clients need new business models built from analyzing customers and business operations at every angle to really understand them.\r\n\r\nWith the power to apply artificial intelligence and data science to business decisions via enterprise data management solutions, we help leading companies prototype, refine, validate, and scale the most desirable products and delivery models to enterprise scale within weeks\r\n\r\n*You must be legally authorized to work in United States/Canada without the need of employer sponsorship, now or at any time in the future *\r\n\r\nJob Title:  Data Modeler (Remote)\r\n\r\nRole/Responsibilities:\r\n\r\n13+ years of experience.\r\nUnderstanding of modeling strategies (Relational, Dimensional, Unstructured)\r\nStrong data modeling expertise data analysis and transformation logic for reporting platforms, support for data scientists and analytics platforms  and maintains a robust inventory of design frameworks and standard.\r\nDemonstrable experience with data modelling tool &ndash; Erwin.\r\nStrong analysis and SQL skills for querying data.\r\n \r\n\r\nSalary and Other Compensation:\r\n\r\n \r\n\r\nThis position is also eligible for Cognizant&rsquo;s discretionary annual incentive program, based on performance and subject to the terms of Cognizant&rsquo;s applicable plans.\r\n\r\n \r\n\r\nBenefits: Cognizant offers the following benefits for this position, subject to applicable eligibility requirements:\r\n\r\nMedical/Dental/Vision/Life Insurance\r\nPaid holidays plus Paid Time Off\r\n401(k) plan and contributions\r\nLong-term/Short-term Disability\r\nPaid Parental Leave\r\nEmployee Stock Purchase Plan\r\n \r\n\r\nDisclaimer: The salary, other compensation, and benefits information is accurate as of the date of this posting. Cognizant reserves the right to modify this information at any time, subject to applicable law.\r\n\r\nCognizant is an Equal Opportunity Employer M/F/D/V. Cognizant is committed to ensuring that all current and prospective associates are afforded equal opportunities and treatment and a work environment free of harassment.\r\n\r\nCognizant is recognized as a Military Friendly Employer and is a coalition member of the Veteran Jobs Mission. Our Cognizant Veterans Network Assists Veterans in building and growing a career at Cognizant that allows them to leverage the leadership, loyalty, integrity, and commitment to excellence instilled in them through participation in military service.\r\n\r\n \r\n\r\n#LI-KV1 #CB #Ind123\r\n\r\nEmployee Status : Full Time Employee\r\n\r\nShift : Day Job\r\n\r\nTravel : No\r\n\r\nJob Posting : Apr 17 2023', 'Cognizant', 'https&colon;&sol;&sol;careers&period;cognizant&period;com&sol;ca&sol;en&sol;job&sol;00053953261&sol;Data-Modeler-Remote', '2023-04-20 03:23:21', '2023-04-20 03:23:21', 0, 0, ''),
(25, 'Не подавался ', 'Cognizant Technology Solutions', 'С', '', '', 'Automation QA Analyst.', 'Cognizant has an immediate opening for Automation QA Analyst.\r\n\r\nJoin our QE&amp;A team today!\r\n\r\n \r\n\r\nNote: Candidate must be comfortable working in hybrid mode (report in person to the Toronto downtown office 3 days a week).\r\n\r\n \r\n\r\nJob Description:\r\n\r\nMinimum 5+ years of Quality Assurance Analyst experience.\r\nMust have 3+ years of hands-on Automation experience using either Java, Selenium or ROBOT framework.\r\nMust have strong exp. In Database testing.\r\nGood experience in SQL having written complex queries.\r\nStrong back-end SQL  and back-end testing experience.\r\nExperience in automating test environments and test data generation.\r\nExperience with Git.\r\nExposure to Jenkins.\r\nCommunication skills should be good as this is a new program where person will have to interact with multiple stakeholders.\r\nWorking exp with Agile methodology.\r\n \r\n\r\n \r\n\r\nCognizant will only consider applicants for this position who are legally authorized to work in Canada without requiring employer sponsorship, now or at any time in the future.\r\n\r\n \r\n\r\nWe are an equal opportunity employer and value diversity at our company. We do not discriminate on the basis of race, religion, colour, national origin, sex, gender, gender expression, sexual orientation, age, marital status, veteran status, or disability status. We will ensure that individuals with disabilities are provided reasonable accommodation to participate in the job application or interview process, to perform essential job functions, and to receive other benefits and privileges of employment. Please contact us to request accommodation.\r\n\r\nEmployee Status : Full Time Employee\r\n\r\nShift : Day Job\r\n\r\nTravel : No\r\n\r\nJob Posting : Apr 10 2023', 'Cognizant', 'https&colon;&sol;&sol;careers&period;cognizant&period;com&sol;ca&sol;en&sol;job&sol;00053836811&sol;Automation-QA-Analyst', '2023-04-20 03:24:20', '2023-04-20 03:24:20', 0, 0, ''),
(26, 'Заполнил на вебсайте', 'Fidelity Talent Source', 'N/A', 'N/A@aa.com', '', 'DATABASE DEVELOPER (PL/SQL)', 'The Expertise You Have\r\n 5+ years of industry experience as an Oracle Data Engineer, and ETL Developer\r\nB.S. degree in Computer Science or equivalent technical/engineering field\r\nHands on and in-depth working experience in Oracle PL/SQL and SQL tuning\r\nWorking experience with Informatica for ETL, Linux shell scripts, and Autosys\r\nCuriosity about writing clean, testable, readable, and easily maintainable code\r\nProven ability in developing Data APIs to support varied application requirements\r\nExposure to GIT Stash, Jenkins, and uDeploy is desirable\r\nProven experience with data analysis and database design.\r\nExperience in native AWS services, Snowflake, and Python\r\nExperience working in Finance and Investing domains will be a plus\r\nExperience working in agile methodology, providing L3 support, and working as part of geographically distributed teams is desirable\r\nKnowledgeable about modern data pipelines, data streaming, and messaging technologies\r\nThe Skills You Bring\r\n Have excellent oral and written communication skills as you will present to everyone from entry-level employees to executives.\r\nThe ability to explain complicated or technical information in a simple way to non-technical audiences.\r\nSet realistic expectations and prioritize within a dynamic and shifting environment.\r\nAre sensitive to clients&rsquo; needs and are adept at developing relationships and engaging users.\r\nHave curiosity and passion about data, visualization and solving problems.\r\nHave willingness to question the validity, accuracy of data and assumptions.\r\nAre eager to learn and deliver in a fast-paced environment and thrill the users.\r\nThe Value You Deliver\r\nWorking closely with the analysts/business partners to understand the business problem\r\nCrafting, developing, and supporting quality solutions that aligns with the technology blueprint and standard methodologies to solve business problems\r\n', 'indeed', 'https&colon;&sol;&sol;www&period;fidelitytalentsource&period;com&sol;job-details&sol;15929377&sol;database-developer-pl-sql-&sol;&quest;sf&lowbar;aid&equals;312f2f82-e6e8-4d2c-8185-19a736596bb0', '2023-04-26 01:12:57', '2023-04-26 01:12:57', 0, 0, ''),
(27, 'На сайте форма', 'People Caddie', 'N/A', '', '', 'Data Engineer', 'Pay rate range:\r\n$60 - $63\r\nCity:\r\nChicago\r\nState:\r\nIllinois\r\nDuration:\r\n02/19/2023 - 08/19/2023\r\nJob Type:\r\nContract\r\nJob Description\r\nSenior Data Engineer\r\n\r\nGlobal Hospitality Company\r\n\r\nRemote\r\n\r\n$60 - $63 / HR (1.5x overtime)\r\n\r\n6 months\r\n\r\n\r\nThe Senior Data Engineer will design, code, test, and analyze software programs and applications. This includes researching, designing, documenting, and modifying software specifications throughout the production lifecycle. This role will also analyze and amend software errors in a timely and accurate fashion and provide status reports where required. The position responsibilities outlined below are not all encompassing. Other duties, responsibilities, and qualifications may be required and/or assigned as necessary.\r\n\r\n\r\nEXPERIENCE AND QUALIFICATIONS:\r\n\r\n\r\nRequired Skills -\r\n\r\n\r\nStrong verbal and written communication skills\r\n\r\nDemonstrate integrity and maturity, and a constructive approach to challenges\r\n\r\nDemonstrate analytical and problem-solving skills, particularly those that apply to Data Warehouse and Big Data environments\r\n\r\nOpen minded, solution oriented and a very good team player\r\n\r\nHands on experience in developing Data Lake and Data Warehouse and Data Marts\r\n\r\nProficiency in SQL and Scripting (Unix sell scripts, Python)\r\n\r\nHands on experience in data pipeline development using modern ETL tools specifically on Informatica PowerCenter, Informatica IICS\r\n\r\nHands on experience in trouble shooting complex ETL and SQL problems\r\n\r\nHands on experience in designing and building data pipelines in AWS cloud using S3, Lambda, API Gateway, RDS, Redshift, etc.\r\n\r\nNice-to-Have Skills -\r\n\r\n\r\nExperience in industry standard ETL/ELT tools\r\n\r\nHands on experience with AWS cloud architecture and development using AWS resources like S3, Lambda, API Gateway, RDS, etc\r\n\r\nProficiency in relational databases (Snowflake, DB2, Redshift, etc), database concepts and dimensional modeling\r\n\r\nExperience in data cleansing, data validation and data wrangling\r\n#PCIT #LI-Remote #Hospitality', 'indeed', 'https&colon;&sol;&sol;www&period;peoplecaddie&period;com&sol;profile&period;php&num;Documents05', '2023-04-26 01:26:40', '2023-04-28 21:05:51', 0, 0, ''),
(28, '$70/ Hour - Wellesley Hills, MA 02481&bull;Remote', 'GTT, LLC - Wellesley Hills, MA 02481&bull;Remote', 'N/A', 'n/a@aa.com', '', 'Senior Application Developer - Remote', 'https://gttit.com/\r\nContract Duration 6 Months\r\nPay rate up to $70/hr\r\n\r\nJob Description:\r\nThe Senior Application Developer improves and implements technical solutions.\r\nThis role leverages technical expertise in database applications, ETL processes, and automation in support of internal and external customers&#039; data exchange and integration needs.\r\n\r\nPrimary Job Responsibilities:\r\nDevelop complex data extracts, applications, and ad-hoc queries as requested by internal and external customers using SQL, SSIS, Informatica, and .NET technologies. Requests include custom flat files, EDI, user applications, and a significant focus on healthcare encounters and HIPAA X12 transactions: 277, 835, 837, 997, 999, TA1.\r\nMaintain the production of Business Intelligence products and solutions, including resolving production issues and responding quickly to priority problems\r\nResearch, troubleshoot, and resolve data issues impacting extract delivery.\r\nWork closely with Business Systems Analysts to understand requirements regarding solutions; ensure data quality and match-back to core systems transaction results.\r\nCollaborate on the definition, development, and maintenance of standards and processes.\r\nDrive continuous improvement and automation in BI solutions and processes.\r\nSupport client goals and objectives by working closely with the management team to deliver value to the business.\r\nOther duties as needed or required.\r\n\r\nRequired Skills:\r\nSenior Application Developer should have expertise in SQL, and SSIS.\r\nThey should be able to use ETL processes using SQL.\r\nShould have expertise in Loading EDI transactions.\r\nShould have HIPPA X12 transactions: 997, 999, TA1.\r\nSenior Application Developers with experience in Informatica would have a strong chance of getting an interview first.\r\n\r\nPreferred Skills:\r\nC# and some OOPS knowledge.\r\nShould be able to read and modify existing code.\r\nEDI.\r\n\r\nRequired Education:\r\nBachelor in Computer Science or related field or relevant experience.\r\n\r\nBenefits:\r\nMedical, Vision, and Dental Insurance Plans\r\n401k Retirement Fund\r\n\r\nAbout the Company:\r\nOur Client is a Leading Financial Services Organization committed to helping people attain healthier lives and Lifetime Financial security. They provide a wide range of protection and wealth products and services like insurance, Advice, investments, and Asset management services in key markets around the world including Canada, the United States, the United Kingdom, Asia, and other parts of the world.\r\nThey have more than 34,000 employees and 112,900 advisors worldwide. Join client organizations and help drive transformation, sustainability, and innovation for our Clients, Employees, partners, and communities.\r\n', 'indeed - Senior Application Developer - Remote 23-03675', 'https&colon;&sol;&sol;gttit&period;com&sol;  &icy; &scy;&acy;&jcy;&tcy; Indeed', '2023-04-26 01:37:07', '2023-04-26 01:37:59', 0, 0, ''),
(29, 'daniel', 'apptoza', 'daniel', 'daniel@apptoza.com', '', 'Role : ETL Developer ( Informatica )', 'Хочет вызвать на беседу. \r\n\r\nRole : ETL Developer ( Informatica )\r\n\r\nLocation : Montreal, QC\r\n\r\nDuration : Long Term\r\n\r\nJob Description:\r\n\r\nInformatica developers load, test, and troubleshoot data, and analyze and test data warehousing systems\r\n\r\nThanks &amp; regards,\r\n\r\nDaniel ( Gopal )\r\n\r\nApptoza Inc.\r\n\r\nPhone: 770-814-2353 Ext 5001\r\n\r\nEmail: daniel@apptoza.com\r\n\r\nWebsite: www.apptoza.com', 'indeed', ' www&period;apptoza&period;com', '2023-04-26 01:58:49', '2023-04-27 22:28:03', 0, 0, ''),
(30, 'HR первоначальное интервью 26 апреля', 'Motion Recruter', 'Jenna Closs linkedin.com/in/jennacloss', '', '6476609882', 'Database Developer', 'As a specialist in wholesale foreign exchange services, EBC provides a wide range of foreign currency exchange and international payment services to financial institutions and corporations tailored to streamline processes and delivered with unparalleled customer service. \r\nExchange Bank of Canada is looking for a proactive, results-driven, and organized professional to join their Data Strategy Team as a Database Developer! \r\nRole Description: \r\nYou will be responsible to deliver database services within the Data Strategy team, providing DBA expertise and support the different areas of the business. As a Database Developer, you will be responsible for designing, developing, managing datasets and performance optimization. You will be part in shaping and building our future state by participating in our data strategy execution.\r\nEssential Functions: \r\n&bull; Define, support, and maintain appropriate data standards while working with business and technical stakeholders to ensure data meets data quality and integrity standards. \r\n&bull; SQL Programming: Write, maintain, and optimize SQL queries. \r\n&bull; Manage and maintain database ETL processes.\r\n &bull; Build high-quality, reusable code that can be used for data integration\r\n &bull; Assess, recommend, and implement processes and tools to improve the organization&rsquo;s data quality and usability. \r\n&bull; Effectively develop data management processes to reduce complexity, improve data quality, and increase efficiency throughout the data management lifecycle.\r\n &bull; Perform root-cause analysis for discrepancies between the reporting, production, and accounting systems.\r\nRequired Education and Experience:\r\n &bull; Bachelor&rsquo;s degree in IT or equivalent experience \r\n&bull; At least 2 years of experience as a database developer \r\n&bull; Knowledge and working experience with ETL processes and software.\r\n &bull; Experience using Microsoft tools such as Excel, PowerPoint, OneDrive necessary to function effectively. \r\nBenefits:\r\n &bull; Family oriented culture with an emphasis on understanding our employees individual needs and growth opportunities \r\n&bull; Commuter Reimbursement - EBC will pay the toll, bus or metro cost in and out of work \r\n&bull; Holiday Pay - Paid day off for 11 designated holidays throughout the year \r\n&bull; Paid Vacation Time Off \r\n&bull; Paid Sick/Personal Time Off\r\n &bull; Health/Dental/Vision Basic Life, AD/D, and Short/Long-Term Disability \r\n&bull; RRSP - Company matches up to 5%', 'linkedin', '&pcy;&acy;&pcy;&kcy;&acy; ', '2023-04-27 02:50:14', '2023-05-02 03:04:04', 0, 0, ''),
(31, 'HR первоначальное интервью 26 апреля', 'Индусы Quantum World Technologies', 'Bal Krishna Pathak', 'bk.pathak@quantumworld.us', '6479466512', 'Informatica + Talend developer', 'As discussed over phone, please confirm the rate CAD$ 45/hr on T4(including vacation pay) for the position Informatica + Talend Developer with the Client Tech Mahindra based in Mississauga ,ON (Remote)and please confirm you are  &ldquo;Canadian Open work permit&rdquo;.\r\n\r\n \r\n\r\nPlease revert with &ndash;&rdquo; I confirm the rate and I am Canadian OWP&rdquo;\r\n\r\n \r\n\r\nInformatica + Talend Developer\r\n\r\nMississauga ,ON (Remote)\r\n\r\nLong Term Contract\r\n\r\n \r\n\r\nJob Description:\r\n\r\n- Experience in Talend and Informatica ETL\r\n\r\n- Strong exp. in SQL &amp; PL SQL\r\n\r\n- Experience in Unix Shell scripting\r\n\r\n- Experience in building framework based data integration using Talend tool\r\n\r\n- Experience in building Talend based ETL workflow to ingest, transform and aggregate data Provide technical support, guidance,\r\n\r\n  and consultation with the issues relating to supported applications\r\n\r\n- Extensive experience in ETL methodology for performing Data Profiling Data Migration Extraction Transformation and Loading using Talend and Informatica\r\n\r\n- Solid experience in implementing complex business rules by creating reusable transformations and robust mappings using Talend transformations\r\n\r\n- Create Talend &amp; Informatica ETL jobs using ETL methodologies and best practices by following naming standards.\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\nThanks &amp; Regards\r\n\r\n \r\n\r\nBal Krishna Pathak\r\n\r\nTeam Lead\r\n\r\nQuantum World Technologies Inc.\r\n\r\n250 Yonge Street, Suite #2201, Unit #10, Toronto, ON, M5B 2L7, Canada  \r\n\r\nwww.quantumworld.us\r\n\r\nE: bk.pathak@quantumworld.us\r\n\r\nOffice: 647-946-6512 Ext-310\r\n\r\nCell:  (647) 250-4376\r\n\r\nFax : 805-834-0532\r\n\r\nLinkedIn-https://www.linkedin.com/in/bal-krishna-pathak-65374a41/', 'linkedin', '&Pcy;&rcy;&icy;&scy;&lcy;&acy;&lcy; &vcy; &pcy;&ocy;&scy;&tcy;&iecy; - &ncy;&iecy; &vcy;&icy;&dcy;&iecy;&lcy; &ncy;&acy; &scy;&acy;&jcy;&tcy;&iecy;', '2023-04-27 03:05:52', '2023-04-27 03:05:52', 0, 0, ''),
(32, 'Отослать напоминание после 30 апреля', 'Paralucent', 'nobody - email (PL411)', 'e+4twd9a343lpvk1up@paralucent.recruitee.com', '', 'В почте ETL Developer', 'Hi Vitalii,\r\nYour application for the ETL Devloper (PL411) position has been successfully submitted. We will only be in touch if we would like to proceed. Alternatively, we will keep your resume on file for future opportunities.\r\n\r\nIf you want to add something to your application just respond to this email.\r\n\r\nNote: please add @paralucent.recruitee.com to your safe senders so that these emails are not sent to your junk folder.\r\n\r\nParalucent', 'other', '', '2023-04-28 02:17:09', '2023-04-28 02:17:09', 0, 0, ''),
(33, 'Вакансия на сайте - remote', 'Keydata', 'N/A', 'info@keydata.ca', '', 'Technical Lead / Architect (ETL Report Development)', 'Technical Lead / Architect (ETL Report Development)\r\nat KeyData Associates (View all jobs)\r\nCanada\r\nAt KeyData, our vision is to be the Global Leader in delivering Identity strategies and solutions to protect and secure our clients and their digital transformation initiatives.\r\n\r\nWith over 16 years of experience, KeyData is a recognized leader in advisory, strategy and professional services specializing in:\r\n\r\nIdentity Governance &amp; Administration (IGA)\r\nPrivileged Access Management (PAM) \r\nCustomer Identity and Access Management (CIAM) \r\nCloud Security\r\nCome join us, you&rsquo;re key to our success!\r\n\r\nWe are currently looking for an Technical Lead / Architect (ETL Report Development) to join KeyData&rsquo;s Delivery Services team! This position (part of or Professional Services team) is responsible for playing the technical lead role in leading building ETL / report development and / or QA practices.  \r\n\r\nIf you&#039;re passionate about working in an environment where you can experience accelerated growth, development and a high impact, this role could be for you! \r\n\r\nLocation: Canada, Remote\r\n\r\nEmployment Type: Contract\r\n\r\nResponsibilities:\r\n\r\nProject delivery of a report development / ETL platform \r\nProvide architectural guidance and lead the initiative with the approach to development \r\nManaging project scope, schedule, budget, resource, status and documentation \r\nPost-sales requirements gathering, analysis and documentation \r\nCommunicating to clients and others regarding aspects of both the solution and the implementation at the technical and/or functional level appropriate for the situation \r\nProvide training and mentoring to client resources \r\nDevelop technical design documents \r\nDevelop technical operating procedures \r\nAbility to work in a distributed team \r\nRequirements: \r\n\r\nSpecial Note:  Hands on Experience in the implementation of an ETL / reporting development platform \r\n\r\n5+ years&rsquo; experience as part of an enterprise software company, security consulting or systems integrator \r\nExperience (5 + years) in leading ETL platform deployments. Only candidates with this experience will be considered. \r\nExperience managing multiple projects at the same time \r\nExperience presenting to senior level stakeholders \r\nExperience in conducting enterprise assessments for clients and developing architectures and roadmaps \r\nExperience translating business requirements into technical designs \r\nExperience managing and leading technical teams \r\nExperience with the following web technologies: XML, SPML/SOAP, Web and Application Servers, HTML \r\nExperience setting up and installing software on both Windows and Unix (Linux, Sun, HP, AIX) platforms \r\nExperience with Databases (Oracle, Sybase, MSSQL, MySQL) \r\nExperience with Directories (LDAP, AD) \r\nExcellent communication skills and extensive experience working with clients and partners \r\nExperience with Project Management duties (project planning, resource management, scope, schedule and status, documentation) \r\nExperience with QA duties is a plus (usability testing, performance testing, automated testing, test scripts, test cases and test plans) \r\nExperience with core Microsoft Office products (Word, Excel, PowerPoint) and collaborative tools (SharePoint) a plus \r\nSecurity software or internal IT audit experience a plus \r\nExcellent communication skills, writing skills and preparing power point presentations \r\nOracle Data Integrator and Golden Gate experience\r\nEducation \r\n\r\nComputer Science, Software Engineering, Information Technology and Security, or equivalent degree. J2EE and CISSP certification is a plus \r\n \r\n\r\nWhy KeyData? \r\n\r\nPeople-First Business &ndash; Our people are our product and our biggest asset, and we treat them as such! We have smart and supportive teammates that make our culture fun and engaging.\r\n\r\nA Place to Accelerate Your Career &ndash; We are in hyper-growth mode and there are extensive opportunities to learn, grow, and advance in different areas of the business.\r\n\r\nLeading IAM Services Organization in North America - We are Gartner recognized, have the most deployments in Canada, and maintain a track record of 100% client satisfaction. We have a dynamic working environment where you have direct impact on business success!\r\n\r\nWe promote equality, diversity (ethnic, cultural, gender, and intellectual), and inclusion, from the top down, as one of the only woman-led Canadian cyber businesses that is WBE-certified. \r\nIf you require accommodation due to a disability at any time during the recruitment and/or assessment process, please contact Talent Acquisition and we will make all reasonable efforts to accommodate your request. \r\n\r\nApply now to join the KeyData team! ', '', 'https&colon;&sol;&sol;keydata&period;ca&sol;careers&quest;gh&lowbar;jid&equals;4187926005', '2023-04-28 03:36:07', '2023-04-28 03:38:07', 0, 0, ''),
(34, 'Remote - HUMANA website', '', 'N/A', '', '', 'Database Developer - SQL', 'Description\r\n\r\nIf you have a desire to make a difference and have a &ldquo;real&rdquo; impact, we want to talk to you!\r\n\r\nHumana&rsquo;s Pharmacy Org is seeking a Senior Software engineer who is self-motivated, Tech savvy, curious and loves the challenge of solving problems that improve people&rsquo;s lives. You&rsquo;ll collaborate with a fun and close-knit agile team to architect, implement, test, and continuously deliver new features and products to our customers.\r\nResponsibilities\r\n\r\nResponsibilities:\r\n\r\nIn this role, you will lead the design, development, and support of our Humana Pharmacy applications\r\n\r\nWriting complex Stored Procedures, User Defined Functions (UDFs), Triggers, Common Table Expressions (CTEs), Table Variables and Views\r\n\r\nTuning T-SQL queries (DDL, DML and DCL) to improve the database performance and availability\r\n\r\nObjects creation such as Tables and Views, Table Normalization, User Created Data Types, User Profiles, Data Dictionaries, Data Integrity, Performance Tuning, Indexes and appropriate Triggers to facilitate efficient data manipulation and data consistency\r\n\r\nDocumenting steps needed to migrate database objects between various environments including Development, UAT, Staging, and Production\r\n\r\nAbility to create new and modify existing reports and using Data Transformation Services (DTS)\r\n\r\nRemediation of issues found during testing candidates need to be problem solvers and troubleshoot existing code based on specifications provided\r\n\r\nProviding Production support responsibilities for the existing SSIS Packages\r\n\r\nParticipating in design and code reviews to maintain our high development standards\r\n\r\nEnsure high quality software through adherence to Test Driven Development (TDD) as the foundation of development and enabling CI/CD and DevSecOps practices\r\n\r\nA proven team player, you&rsquo;ll have the opportunity to provide hands-on leadership while taking an active role in collaborative assessments and design\r\n\r\nCollaborate with and across Agile teams to design, develop, test, implement, and support technical solutions in full-stack development tools and technologies\r\n\r\nTroubleshoots business and production issues by gathering information (for example, issue, impact, criticality, possible root cause); engaging support teams to assist in the resolution of issues; formulating an action plan; performing actions as designated in the plan; interpreting the results to determine further action; performs root cause analysis to prevent future occurrence of issues; and completing online documentation\r\n\r\n               \r\n\r\nRequired Qualifications\r\n\r\nRequired Qualifications:\r\n\r\nBachelor&#039;s Degree in Computer Science, Engineering, Management Information Systems, or equivalent education or work experience\r\n\r\nSenior SSIS developer with a strong technical background in SQL Server who has extensive knowledge in designing, developing, testing and maintaining SQL data and ETL packages using SSIS\r\n\r\n9+ years of experience with SQL Server/T-SQL programming in creation and optimization of stored procedures, triggers, and user defined functions\r\n\r\n8+ years of experience developing and architecting complex SSIS packages\r\n\r\nProfessional development experience using SQL, SSIS, SQL Job Agent, Python, SSRS, APIs, JSON, XML, PowerShell, Windows task scheduler\r\n\r\nAbility to write high performing complex queries\r\n\r\nExperience managing and monitoring database server environments, familiar with SQL profiler\r\n\r\nBest practices for data development within a PCI environment\r\n\r\nStrong understanding data modeling\r\n\r\nDeep understanding of relational database design concepts and SQL programming\r\n\r\nConceptual, logical, and physical model design, experience with Operation Data Stores, Enterprise Data warehouses and Data Marts)\r\n\r\nExperience working with clients to develop and document system requirements\r\n\r\nExperience writing SQL/Functions/Procedures in transactional database systems such as Oracle, SQL Server, DB2\r\n\r\nPreferred Qualifications\r\n\r\nTechnical background in SQL Server who has extensive knowledge in designing, developing, testing and maintaining SQL data and ETL packages using SSIS\r\n\r\nExperience with SQL Server/T-SQL programming in creation and optimization of stored procedures, triggers, and user defined functions\r\n\r\nExperience using SQL, SSIS, SQL Job Agent, Python, SSRS, APIs, JSON, XML, PowerShell, Windows task scheduler\r\n\r\nExperience managing and monitoring database server environments, familiar with SQL profiler\r\n\r\nStrong understanding data modeling\r\n\r\nDeep understanding of relational database design concepts and SQL programming\r\n\r\nConceptual, logical, and physical model design, experience with Operation Data Stores, Enterprise Data warehouses and Data Marts\r\n\r\nMaster&#039;s Degree\r\n\r\nAdditional Information\r\n\r\nWork-At-Home Requirements\r\n\r\nWAH requirements: Must have the ability to provide a high-speed DSL or cable modem for a home office. Associates or contractors who live and work from home in the state of California will be provided payment for their internet expense.\r\n\r\nA minimum standard speed for optimal performance of 25&times;10 (25mpbs download x 10mpbs upload) is required.  \r\n\r\nSatellite and Wireless Internet service is NOT allowed for this role.\r\n\r\nA dedicated space lacking ongoing interruptions to protect member PHI / HIPAA information\r\n\r\n#LI - Remote\r\n\r\nScheduled Weekly Hours', 'Humana', 'https&colon;&sol;&sol;humana&period;wd5&period;myworkdayjobs&period;com&sol;Humana&lowbar;External&lowbar;Career&lowbar;Site&sol;job&sol;Remote-Kentucky&sol;Database-Developer---SQL&lowbar;R-304091&quest;source&equals;Linkedin', '2023-04-28 04:16:02', '2023-04-29 01:20:47', 0, 0, '');
