(35, 'На сайте через Linkedin', 'icims', 'N/A', 'aa@gmail.com', '', 'ETL Developer (remote)', 'Overview\r\nKnowledge Services is seeking a remote ETL Developer for a 12-month contract (potential for extension) with the State of Maine Department of Health and Human Resources.  Applicants are able to work 100% remotely and position is benefit eligible! \r\n\r\n \r\n\r\nResponsibilities\r\nThe ETL Developer Responsibilities: \r\n\r\n&bull; Analyze Data Migration and Integration Error/Warning reports and propose solutions for remediation\r\n&bull; Validate migrated data and track issues\r\n&bull; Verify interfaces and track issues\r\n&bull; Retest remediated data validation and interface verification issues\r\n&bull; Participate in recurring weekly data migration and validation meetings\r\n\r\nQualifications\r\nThe ETL Developer Requirements:\r\n\r\n&bull; 3+ years of experience with ETL Error Report and Data Analysis\r\n&bull; Experience with Data Migration Validation and Data Integration Verification\r\n\r\n&bull; Experience with analyzing Data Migration and Integration Errors/Warnings, determining root cause, and proposing solutions for remediation.\r\n\r\n&bull; Experience with manually validating migrated data, tracking defects, and revalidating remediated issues\r\n&bull; Experience with Complex ETL Data Migration from Multiple Source Systems\r\n\r\n&bull; Experience with Windows 10 and Office 2016\r\n&bull; Experience with SharePoint\r\n&bull; Experience with MS Teams preferred\r\n\r\n \r\n\r\n \r\n\r\nKnowledge Services is an equal opportunity employer, and all qualified applicants will receive consideration for employment without regard to race, color, religion, sex, sexual orientation, gender identity or expression, pregnancy, age, national origin, disability status, genetic information, protected veteran status, or any other characteristic protected by law.\r\n\r\n\r\nApplicants with disabilities may contact the Talent Division via telephone, e-mail, and other means to request and arrange for accommodations. If you need assistance to accommodate a disability, you may request an accommodation at any time. Please contact the Talent Services Team at TalentHR@knowledgeservices.com or 317.806.0005.', 'icims', 'https&colon;&sol;&sol;careers-knowledgeservices&period;icims&period;com&sol;jobs&sol;26352&sol;job&quest;mobile&equals;false&amp;width&equals;1216&amp;height&equals;500&amp;bga&equals;true&amp;needsRedirect&equals;false&amp;jan1offset&equals;-300&amp;jun1offset&equals;-240', '2023-04-28 04:33:48', '2023-04-28 04:33:48', 0, 0, ''),
(36, 'На сайте отослал резюме Job #: 22-03039', 'Ark solutions', 'n/a', 'na@gmail.com', '', 'ETL Developer - remote', 'Application for job # 22-03039\r\nJob Description\r\n\r\n4.1. With the guidance of the CDE Enterprise Architect and Presentation Layer Developer (Team Lead), the contractor shall review internal CDE documentation and use this information to design a reporting layer on Azure environment.\r\n4.2. Required Experience:\r\n5 years of experience developing using Drupal.\r\n3 years of experience making web content compliant with the Americans with Disability Act (ADA).\r\n3 years of experience using Tableau Desktop to create visuals.\r\n3 years of experience using SQL.\r\n4.3. Requirements Gathering and Data Modeling Skills\r\nStrong requirements gathering skills: ability to work with customers to gather reporting requirements and translate into a data model for reporting using Tableau, Power BI, and Ad-hoc queries.\r\nStrong administrative skills including repository management and knowledge of best practices regarding aggregate tables and data marts.\r\n4.4. Azure and Data Warehouse ETL Skills\r\nExperience working on Azure and implementing reporting layer tables using ETL logic which pulls data from an Oracle or SQL Server database.\r\nExperience working with star schemas and loading reporting layer table.\r\nPreferred experience with Informatica or IICS or similar ETL tool.\r\n4.5. Business Intelligence Skills\r\nExperience creating dashboards using Tableau or Power BI. Experience working with the creation of data sources and actual implementation of visualization dashboards.\r\n4.6. Strong oral and written communication skills working with both business users and technical staff\r\n4.7. The contractor shall demonstrate their understanding of the overall project goals and the specific goals as pertains to the contractors assignment for this project to the satisfaction of the Project Manager.\r\n4.8. The contractor be able to advise and provide guidance on the requested work.\r\n4.9. The contractor shall develop, maintain, and support Extract Transform and Load processes which are written using Informatica and/or SQL.\r\n4.10. The contractor shall use Informatica and/or SQL to pull data from the CDE Data Warehouse tables and generate new aggregated data in summary tables which will be utilized for the creation of visuals.\r\n4.11. The contractor shall have experience in web development using Drupal on an Apache Server.\r\n4.12. The contractor shall have experience integrating Tableau or Power BI visuals into the web environment using Drupal on an Apache Server.\r\n4.13. The contractor shall have experience in implementing ADA accessibility requirements and best practices when developing visuals using Tableau or Power BI.\r\n4.14. The contract shall have experience in implementing ADA accessibility requirements and best practices when developing web pages.\r\n4.15. The contractor shall thoroughly test and document each step taken and perform knowledge transfer to the CDE staff.\r\n4.16. Preferred Skills:\r\nConnecting Drupal to an external database, Oracle preferred.', 'jobdiva.com', 'https&colon;&sol;&sol;www2&period;jobdiva&period;com&sol;portal&sol;&quest;a&equals;hdjdnwt3oqdy1dsj4sou8i7vyoimqj03bekdzg89i3qyi2p5pohpfah42mexnfsd&amp;jobid&equals;17780204&num;&sol;jobs&sol;17780204&quest;compid&equals;0&amp;SearchString&equals;&amp;StatesString&equals;&amp;id&equals;17780204&amp;source&equals;linkedin&period;com', '2023-04-28 04:40:49', '2023-04-28 04:41:50', 0, 0, ''),
(37, 'MS Access - фрилансер', 'Genesis - небольшая компания', 'N/A', 'na@gmail.com', '', 'Access DB Experts - Remote', 'We are a small database development company that creates and supports Microsoft Access databases.\r\n\r\nWe need an individual who can provide development for some of our Access projects on a part-time freelance basis. We need someone with strong access experience. The successful candidate will be a self-starter with strong communication skills. This person will have the ability to work remotely (location unimportant) and have the flexibility to prioritize projects as they come in. To start, we anticipate this person will have 10-30 hrs per week. Successful candidates will have the opportunity for more hours, flexibility and advancement. Location is unimportant as all work will be done remotely.\r\n\r\nThe Freelance Developer position involves the following tasks\r\n\r\n&middot; Full database creation &ndash; create MS Access databases from scratch\r\n&middot; Modify database &ndash; transform MS Access databases as per specs/requirements\r\n&middot; Transform Excel programs to Access databases\r\n&middot; Upgrade MS Access DBs to more recent versions of Access\r\n&middot; Reports - Create/modify\r\n&middot; Forms - Create/modify\r\n&middot; Queries - Create/modify\r\n&middot; Tables &ndash; Create/modify\r\n&middot; VBA &ndash; Coding\r\n&middot; Quality control testing\r\n&middot; Work with Sr Programmers and rest of team on large projects.\r\n&middot; Speak with/email clients to understand their needs\r\n&middot; Respond to comments from clients, as well as, updating Requirements\r\n&middot; Create manuals and other support documents\r\n&middot; Help desk support\r\n\r\nMust have:\r\n\r\n1. 1000+ hours access database experience\r\n2. Able to communicate easily and successfully, in English, both verbally and in writing\r\n3. Excellent time management skills and ability to work independently (remotely) while managing your own time and providing time estimates and status updates.\r\n4. Comfort and ease when dealing with clients\r\n5. Be able to adapt and quickly develop an understanding of new/different applications\r\n\r\nNice to have (but not required)\r\n1. SQL server experience\r\n2. Experience with other database programs\r\n3. Past jobs with similar and related skills: DBA, administrator, software engineer, architect, business analysis\r\n\r\nJob Types: Full-time, Part-time, Freelance\r\n\r\nSalary: $50,000.00-$80,000.00 per year\r\n\r\nBenefits:\r\n\r\nCasual dress\r\nFlexible schedule\r\nWork from home\r\nSchedule:\r\n\r\nMonday to Friday', 'indeed', 'https&colon;&sol;&sol;ca&period;indeed&period;com&sol;cmp&sol;Genesis-Databases-2&sol;jobs&quest;jk&equals;6a5e5b9ad59c2fb1&amp;start&equals;0&amp;clearPrefilter&equals;1', '2023-04-28 05:05:51', '2023-04-28 05:05:51', 0, 0, ''),
(38, '', 'gainwelltechnologies', 'N/A', 'na@gmail.com', '', 'ETL Developer', 'ETL Developer\r\nDate:  Apr 8, 2023\r\nLocation:  Any city, KY, US, 99999\r\nReq ID:  17002\r\nBe part of a team that unleashes the power of leading-edge technologies to help improve the health and well-being of those most vulnerable in our country and communities. Working at Gainwell carries its rewards. You&rsquo;ll have an incredible opportunity to grow your career in a company that values work flexibility, learning, and career development. You&rsquo;ll add to your technical credentials and certifications while enjoying a generous, flexible vacation policy and educational assistance. We also have comprehensive leadership and technical development academies to help build your skills and capabilities.\r\n\r\n \r\n\r\nSummary\r\n \r\n\r\nAs a ETL Developer at Gainwell, you can contribute your skills as we harness the power of technology to help our clients improve the health and well-being of the members they serve &mdash; a community&rsquo;s most vulnerable. Connect your passion with purpose, teaming with people who thrive on finding innovative solutions to some of healthcare&rsquo;s biggest challenges. Here are the details on this position.\r\n\r\nYour role in our mission\r\n \r\n\r\nDevelops, tests, manages, and implements ETL packages and applications within the standards set by the team.\r\nCollaborates with Data Analysts to design processes that meet Business requirements\r\nPerforms standard ETL administration tasks such as deployment, package migration, and managing metadata while following Release Management policies  \r\nActively participates in unit and system testing\r\nEngages with other senior team members to complex solve problems.\r\nWhat we&#039;re looking for\r\n \r\n\r\n2+ years - Analytical skills in a SQL Server environment\r\n2+ years - ETL design and development knowledge using the Microsoft BI tool set, specifically SSIS\r\n2+ years &ndash; Performance tuning complex SQL\r\nExcellent verbal and written communication skills\r\nPreferred &ndash; Experience working with Healthcare data sets\r\nWhat you should expect in this role\r\nOpportunities to travel through your work (0-10%)', 'linkedin', 'https&colon;&sol;&sol;jobs&period;gainwelltechnologies&period;com&sol;Gainwell&percnt;20Technologies&percnt;20LLC&sol;job&sol;Any-city-ETL-Developer-KY-99999&sol;1003069100&sol;', '2023-04-28 05:25:17', '2023-04-28 05:25:17', 0, 0, ''),
(40, 'TalentBurst, an Inc 5000 company ', 'TalentBurst', '', '', '', 'Oracle ETL backend developer #: 23-06859', 'Второй линк на вакансию\r\nhttps://www1.jobdiva.com/portal/?a=y5jdnwgsfix0t1d7osw75h145zxdtm008fvae292vxos9unusglbuzpszehgbfa0#/jobs/23656695\r\n\r\nAbout the job\r\nJob Description\r\n\r\nTitle: Oracle ETL backend developer\r\n\r\nLocation: Fully remote\r\n\r\nDuration: 11-12&amp;plus; months contract to hire\r\n\r\nMust Have\r\n\r\nOracle ETL backend developer:\r\n\r\n5&amp;plus; years of PL/SQL &amp; Oracle Database development experience\r\n\r\nRecent Oracle PL/SQL development experience within the past year\r\n\r\nDetailed knowledge of Near Real Time Oracle ETL processes\r\n\r\nDetailed knowledge of Oracle PL/SQL Run Time improvement\r\n\r\nExperience in ETL PL/SQL development\r\n\r\nExperience in documenting ETL Technical Designs\r\n\r\nOracle 19C usage a plus\r\n\r\nOracle RAC experience a plus\r\n\r\nPrimary Purpose\r\n\r\nTo develop, maintain, test and debug software to meet generally defined requirements in a Windows client/server environment utilizing software development languages/environments such as PL/SQL, Oracle, Progress 4 GL Application Development Environment (ADE), .Net, Microsoft SQL, or other platforms; to formulate and define system scope and objectives through research and fact-finding for the purpose of developing or modifying moderately complex information systems; to prepare detailed specification from which programs will be written; and to design, code, test, debug, document and maintain programs.\r\n\r\nESSENTIAL FUNCTIONS And RESPONSIBILITIES\r\n\r\nBecomes familiar with most aspects of the application including reports, parameters, claims management, intake services, carrier/client interfaces and vendor/business partner interfaces.\r\n\r\nAnalyzes user needs as required; assists in the design of specifications to meet end user needs.\r\n\r\nDevelops and modifies software to meet the specifications outlined in data processing requests.\r\n\r\nDevelops and maintains software to meet requirements of insurance carrier and regulatory groups.\r\n\r\nTests and debugs assigned projects; assists in testing projects for other members of the programming staff.\r\n\r\nPrepares documentation on new or existing software.\r\n\r\nInvestigates call escalations from the support staff; makes the necessary corrections to data and/or software.\r\n\r\nAssists in the professional growth of programmers.\r\n\r\nFollows departmental pre-established standards and guidelines as they pertain to design and development.\r\n\r\nAdheres to the goal of delivering and maintaining the highest quality of customer service to our clients.\r\n\r\nKeeps abreast of software development language revisions and technology advances.\r\n\r\nADDITIONAL FUNCTIONS And RESPONSIBILITIES\r\n\r\nPerforms other duties as assigned.\r\n\r\nSupports the organization&#039;s quality program(s).\r\n\r\nQualifications\r\n\r\nEducation &amp; Licensing\r\n\r\nBachelor&#039;s degree from an accredited college or university required. Information Systems or Computer Science major preferred.\r\n\r\nExperience\r\n\r\nSix (6) years of language development in a relevant and applicable language and/or business analytical experience or equivalent combination of education and experience required. Proven experience in interpreting user requirements, business applications design, and development of business applications strongly preferred.\r\n\r\nSkills &amp; Knowledge\r\n\r\nStrong knowledge of language development and applications design\r\n\r\nAnalytical and interpretive skills\r\n\r\nStrong organizational skills\r\n\r\nExcellent interpersonal skills\r\n\r\nExcellent negotiation skills\r\n\r\nAbility to work in a team environment\r\n\r\nAbility to meet or exceed Performance Competencies\r\n\r\nWORK ENVIRONMENT\r\n\r\nWhen applicable and appropriate, consideration will be given to reasonable accommodations.\r\n\r\nMental: Clear and conceptual thinking ability; excellent judgment, troubleshooting, problem solving, analysis, and discretion; ability to handle work-related stress; ability to handle multiple priorities simultaneously; and ability to meet deadlines\r\n\r\nPhysical: Computer keyboarding, travel as required Job #: 23-06859', 'linkedin', 'https&colon;&sol;&sol;www&period;linkedin&period;com&sol;jobs&sol;view&sol;3567915841&sol;&quest;alternateChannel&equals;search&amp;refId&equals;V91KOn7p5ugFlNrc5Rx7qQ&percnt;3D&percnt;3D&amp;trackingId&equals;mNeyd1C6C&percnt;2BCNrFY5ON9WUQ&percnt;3D&percnt;3D&amp;trk&equals;d&lowbar;flagship3&lowbar;search&lowbar;srp&lowbar;jobs', '2023-04-28 05:29:15', '2023-04-28 05:30:21', 0, 0, ''),
(41, 'Очень интересная!! Техас удал&#039;нка', 'Luna Data Solutions, Inc.  Texas, United States Remote', '', '', '', 'ETL Developer', 'About the job\r\nWe are currently hiring an Extract Transfer and Load (ETL) Developer for a long-term contract in support of our client in Austin, Texas. This position can be worked remotely within the state of Texas. The ideal ETL Developer will have excellent communication, technical writing, and collaborative skills. In addition, the roles and responsibilities of the ETL Developer may include, but not be limited to the following:\r\n\r\nDesigning, developing, and testing ETL processes for the data warehouse.\r\nDeveloping and documenting ETL processes to extract data from existing systems into the data warehouse.\r\nDocumenting the &ldquo;as-is&rdquo; schemas currently in use at the client site(s).\r\nPerforming other analysis and documentation tasks as required to facilitate and support the client&rsquo;s Enterprise Data Warehouse\r\nWriting code to populate the data structures.\r\n\r\nMinimum Requirements:\r\n\r\n1+ years of work experience designing and developing Extraction, Transformation, Load (ETL) processes for using Informatica; Deep hands-on expertise with Informatica ETL processes, development, data management, data profiling, data flows, data relationships, and data quality standards and processes.\r\n1+ years of hands-on experience with data warehouse development (relational and dimensional) and proven evidence to implement using databases like Oracle, SQL Server etc.\r\n1+ years of work experience with data modeling.\r\n1+ years of work experience with Informatica product suite in the Informatica cloud.\r\n\r\nHighly Preferred Qualifications:\r\n\r\n1+ years of relevant work experience with ERWin or other equivalent data modeling tools\r\n1+ years of relevant work experience working with more than one type of RDBMS (Informix, SQLServer, Oracle, etc.)\r\n1+ years of related work experience supporting government agencies\r\n1+ years of work experience with TWC environment and technology platforms\r\nCertified Data Management Professional (CDMP)', '', 'https&colon;&sol;&sol;www&period;linkedin&period;com&sol;jobs&sol;view&sol;3573060107&sol;&quest;alternateChannel&equals;search&amp;refId&equals;V91KOn7p5ugFlNrc5Rx7qQ&percnt;3D&percnt;3D&amp;trackingId&equals;3AQKydI58CQv4EDj7wtxVg&percnt;3D&percnt;3D&amp;trk&equals;d&lowbar;flagship3&lowbar;search&lowbar;srp&lowbar;jobs', '2023-04-28 05:32:02', '2023-04-28 05:32:02', 0, 0, ''),
(42, 'Remote MS SQL', 'American Speciality Health - California', '', '', '', 'Sr Database Engineer I (Remote)', 'https://www.linkedin.com/jobs/view/3587298381/?alternateChannel=search&amp;refId=BywURqwsRE%2BT7eFkxsHOTA%3D%3D&amp;trackingId=7tcsXYD3R5uEYDhDv0nIqw%3D%3D\r\n\r\n\r\nDescription\r\nAmerican Specialty Health Incorporated is seeking a Sr. Database Engineer I to join Information Technology Operations department. This position will provide high quality Design and T-SQL code to your Agile teams, open lines of communication with the application engineers and your fellow database team members, high quality of work and communicating as accurate a timeline as possible. \r\n\r\nRemote Worker Considerations\r\n\r\nCandidates who are selected for this position will be trained remotely and must be able to work from home in a designated work area with company-provided technology equipment. This remote/WFH position requires you have a stable connection to your Internet Service Provider with the ability to participate by video in online meetings over a reliable and consistent network (minimum internet download of 50 Mbps and 10 Mbps upload speed).  \r\n\r\nResponsibilities\r\n\r\nModeling database objects and independently providing solutions to your customer without the need for guidance.\r\nShredding and understanding older code without the need to know everything about a business process.\r\nMaintaining and enhancing the performance of existing database programs.\r\nAssisting database development teams in designing new database programs that meet the organization&#039;s performance needs.\r\nMonitoring databases and related systems to ensure optimized performance.\r\nWriting new support programs and scripts in support of development teams.\r\nPerforming debugging procedures on database scripts and programs, as well as resolving conflicts.\r\nAdhering to best practices in securely storing, backing up, and archiving data.\r\nDocumenting processes related to database design, configuration, and performance.\r\nKeeping abreast of developments and best practices in database engineering.\r\nDesign, troubleshoot and optimize SSIS packages to meet business needs.\r\nIndependently analyze, solve, and correct issues in real time, providing problem resolution end-to-end.\r\nServe as escalation point for troubleshooting minor to major problems on an as-needed basis; often requiring time sensitive response and pro-active communication to different groups within the organization Requirements.\r\nContribute to the creation of processes, procedures and standards for SQL Server database administration that supports the use of optimal database server resources and performance to minimize potential downtime scenarios.\r\nDefining requirements for automating routine database service delivery processes and collaborating with peers to develop and enhance existing database service delivery automation solutions.\r\nParticipate in design and architecture review of the databases and applications. Lead efforts with database topology review and communicate with multiple teams to finalize optimal design for databases and applications.\r\nMentoring Application Developers on the best way to accomplish a goal.\r\nAssist developers with complex query tuning and schema refinement.\r\nQualifications\r\n\r\nBachelor&rsquo;s degree in an IT related field or equivalent experience. If equivalent experience, high school diploma required.\r\n3 &ndash; 5 years of prior experience with T-SQL coding at a Master level. Familiar with SQL Server 2012 all the way through SQL Server 2019.\r\nEvidence of continuous learning and being part of the SQL community (certifications, training, group associations) is preferred.\r\nKnowledge of the Agile methodology.\r\nDatabase modeling with a focus on OLTP environments. Experience working with a modeling tool like ER/Studio is preferred.\r\nExperience working within 2-week sprints as part of an agile scrum team including being able to determine effort, commit to requirements, and deliver product.\r\nExperience creating, supporting, and troubleshooting existing stored procedures, functions, views, and all other database objects.\r\nExperience creating, supporting, and troubleshooting existing SQL Agent Jobs that span multiple databases and perform ETL processing.\r\nExperience performance tuning complex TSQL statements across multiple databases.\r\nExperience with managing and deploying database changes to different environments in support of the software development lifecycle. A familiarity with SQL Server Database Projects in Visual Studio is preferred.\r\nExperience developing and troubleshooting SSIS packages from SQL 2012 forward, including the SSIS Catalog is preferred.\r\nA firm understanding of SQL Server best practices and conforming to database design standards.\r\nKnowledge and/or experience working with Azure Data Factory is a plus.\r\nKnowledge and/or experience working with Azure SQL Database is a plus.\r\nCore Competencies\r\n\r\nDemonstrated ability to interact in a positive, respectful manner and establish and maintain cooperative working relationships.\r\nAbility to display excellent customer service to meet the needs and expectations of both internal and external customers.\r\nExcellent listening and interpersonal communication skills to identify critical core competencies based on success factors and organizational environment.\r\nAbility to effectively organize, prioritize, multi-task and manage time.\r\nDemonstrated accuracy and productivity in a changing environment with constant interruptions.\r\nDemonstrated ability to analyze information, problems, issues, situations and procedures to develop effective solutions.\r\nAbility to exercise strict confidentiality in all matters.\r\nMobility\r\n\r\nPrimarily sedentary, able to sit for long periods of time. \r\n\r\nPhysical Requirements\r\n\r\nAbility to speak, see and hear other personnel and/or objects. Ability to communicate both in verbal and written form. Ability to travel within the facility. Capable of using a telephone and computer keyboard. Ability to lift up to 10 lbs.\r\n\r\nEnvironmental Conditions\r\n\r\nOffice and/or Work-from-home (WFH) environment.\r\n\r\nSalary Range\r\n\r\nAmerican Specialty Health complies with state and federal wage and hour laws and compensation depends upon candidate&rsquo;s qualifications, education, skill set, years of experience, and internal equity. $112,500.00 to $143,00.00 Full Time Annual Salary Range.\r\n\r\nAmerican Specialty Health is an Equal Opportunity/Affirmative Action Employer.\r\n\r\nAll qualified applicants will receive consideration for employment without regard to race, color, religion, sex including sexual orientation and gender identity, national origin, disability, protected Veteran Status, or any other characteristic protected by applicable federal, state, or local law. \r\n\r\nPlease view Equal Employment Opportunity Posters provided by OFCCP here.\r\n\r\nIf you are a qualified individual with a disability or a disabled veteran, you have the right to request an accommodation if you are unable or limited in your ability to use or access our career center as a result of your disability. To request an accommodation, contact our Human Resources Department at (800) 848-3555 x6702.\r\n\r\nASH will not discharge or in any other manner discriminate against employees or applicants because they have inquired about, discussed, or disclosed their own pay or the pay of another employee or applicant. However, employees who have access to the compensation information of other employees or applicants as a part of their essential job functions cannot disclose the pay of other employees or applicants to individuals who do not otherwise have access to compensation information, unless the disclosure is (a) in response to a formal complaint or charge, (b) in furtherance of an investigation, proceeding, hearing, or action, including an investigation conducted by the employer, or (c) consistent with the Company&rsquo;s legal duty to furnish information.\r\n#LI-Remote', 'linkedin', 'https&colon;&sol;&sol;jobs&period;jobvite&period;com&sol;ashcompanies&sol;job&sol;oD7Cmfws', '2023-04-28 06:11:01', '2023-04-28 06:11:01', 0, 0, ''),
(43, 'Подался на сайте', 'PopHealthCare', '', '', '', 'Developer Sr., ETL', 'https://www.paycomonline.net/v4/ats/web.php/application/MyApplications#!applications\r\nJob Details\r\n\r\nJob Location\r\n\r\nWork From Home - ,\r\n\r\nRemote Type\r\n\r\nFully Remote', 'linkedin', 'https&colon;&sol;&sol;www&period;linkedin&period;com&sol;jobs&sol;view&sol;3577771918&sol;&quest;alternateChannel&equals;search&amp;refId&equals;BywURqwsRE&percnt;2BT7eFkxsHOTA&percnt;3D&percnt;3D&amp;trackingId&equals;07LM4&percnt;2BqORkSlXubm&percnt;2BAW5BQ&percnt;3D&percnt;3D&amp;trk&equals;d&lowbar;flagship3&lowbar;jobs&lowbar;discovery&lowbar;preScreening', '2023-04-28 06:13:49', '2023-04-28 06:46:34', 0, 0, ''),
(44, '', 'Synovus', '', '', '', 'Remote API &amp; ETL Developer', 'Job Summary\r\n\r\nWorks closely with more experienced developers and production Database Administrators to ensure scalable, efficient and optimized solutions. Works closely with customers, management, business analysts, and team members to understand business requirements that drive the analysis and design of quality technical solutions. Ensures solutions are aligned with business and Information Technology strategies and comply with the organization&#039;s architectural standards. Designs, develops, maintains and improves data structures, queries, reporting solutions, extract-transform-load (ETL) processes and data warehousing strategies for all mission critical projects. Works closely with team members on the daily execution of deliverables and to continue to gain knowledge and development in the Developer role.\r\n\r\nJob Duties and Responsibilities\r\n\r\nWorks on multiple projects as a member of the project team. Participates in systems and data analysis, design, development, integration, and enhancement activities, as well as related maintenance and production support.\r\nAssists in the development of project scope and may serve as a project point of contact when necessary. Participates in project-planning sessions with customers, business analysts, and team members to analyze development requirements, provide design recommendations for complex systems, and recommend methods and assignments.\r\nConducts unit tests ensuring systems meet the needs of customer and line-of-business based on technical documentation. Provides ongoing maintenance of web applications and/or client/server applications or tools, depending upon previous involvement with projects.\r\nAssists with the management of unresolved production support issues. Assists with the development of application and custom integration solutions, including major enhancements and interfaces.\r\nMakes modifications to existing software applications and modules in accordance with technical specifications and division standards. Reviews efforts to ensure compliance to application standards.\r\nFollows documented and approved Systems Development Life Cycle (SDLC) process and makes recommendations toward the development of reusable routines or components, including object-oriented base class reuse.\r\nTranslates business and technical requirements into cross-functional business application systems, providing custom integration solutions, including major system enhancements. Collaborates with team members in setting development guidelines.\r\nProvides application support as needed during regular and after hours.\r\nRemains informed and proficient regarding applicable industry technical innovations, trends, standards and new developments. Maintains current skills and remains knowledgeable regarding new tools and computer languages as applicable.\r\nEach team member is expected to be aware of risk within their functional area. This includes observing all policies, procedures, laws, regulations and risk limits specific to their role. Additionally, they should raise and report known or suspected violations to the appropriate Company authority in a timely fashion.\r\nPerforms other related duties as required\r\nThe information on this description has been designed to indicate the general nature and level of work performed by employees within this classification. It is not designed to contain or be interpreted as a comprehensive inventory of all duties, responsibilities, and qualifications required of employees assigned to this job.\r\n\r\nSynovus is an Equal Opportunity Employer supporting diversity in the workplace\r\n\r\n\r\nMinimum Education:\r\n\r\nBachelor&#039;s degree in computer science, information systems or a related field or an equivalent combination of education and experience.\r\nMinimum Experience:\r\n\r\nThree years of related experience including data design and project management, using multiple programing languages, and using and managing metadata.\r\nRequired Knowledge, Skills, &amp; Abilities:\r\n\r\nSolid understanding of systems development life cycle (SDLC), software best practices and development methodologies\r\nStrong technologist with excellent data analysis and ETL skills\r\nKnowledge of Master Data Management (MDM) and Governance\r\nUnderstanding of multiple programming languages, systems, as well as data design and project management methodologies.\r\nStrong architecture, design, and development skills\r\nUnderstanding of building data warehouses for analytical and business intelligence solutions\r\nUnderstanding of business solutions that the data warehouse serves\r\nStrong analytical and diagnostic skills\r\nSkill in developing and organizing high-quality documentation\r\nSkill and flexibility managing multiple projects with large volumes of data in a rapidly changing environment\r\nSkill troubleshooting issues in a multi-tier environment\r\nSkill working with both business team members and technologists\r\nLeadership skills with an emphasis on teamwork\r\n\r\nPreferred Knowledge, Skills, &amp; Abilities:\r\n\r\nMicrosoft Certified Solutions Expert (MCSE), Microsoft Certified Database Administrator (MCDBA), Certified Data Management Professional (CDMP) or a Business Intelligence designation\r\nKnowledge of data modeling and designing databases\r\nKnowledge of various databases such as MySQL and Oracle\r\nKnowledge of scripting languages such as C# and VB.Net\r\nKnowledge of System DB\r\nExperience in one or more Synovus lines-of-business\r\nExperience in the banking/financial services industry\r\n#LI-SR1\r\n#LI-Remote', 'linkedin', 'https&colon;&sol;&sol;careers&period;synovus&period;com&sol;us&sol;en&sol;job&sol;SYNOUS22156EXTERNALENUS&sol;Remote-API-ETL-Developer&quest;utm&lowbar;source&equals;linkedin&amp;utm&lowbar;medium&equals;phenom-feeds', '2023-04-28 06:48:40', '2023-04-28 06:48:40', 0, 0, ''),
(47, '', 'Diamond Pick', 'Karthik Narayanan', '', '', 'Talend Developer', 'Job Description\r\nTalend Developer\r\nRemote\r\nData and Analytics professionals define strategies, develop and deliver solutions that enable the collection, processing and management of information from one or more sources, and the subsequent delivery of information to audiences in support of key business processes.\r\nProduce clean, standards based, modern code with an emphasis on advocacy toward end-users to produce high quality ETL applications that are well-documented.\r\nDemonstrate an understanding of technology and digital frameworks in the context of data integration.\r\nEnsure code and design quality through the execution of test plans and assist in development of standards, methodology and repeatable processes, working closely with internal and external design, business, and technical counterparts.\r\nBasic Qualifications :\r\nOver 7+ of experience including devolvement and implementing ETL with Talend\r\nPreferred Qualifications :\r\nExperience in designing, developing, validating and deploying the Talend ETL processes.\r\nExperience with Talend Data Integration: Design, develop Talend ETL scripts, creating and deploying end to end Talend Data Integration solution.\r\nExperience on Informatica to assess the ETL and Migrate in Talend,\r\nExperience with a full life-cycle development from functional design to deployment\r\nDatabase experience (Teradata, Oracle, SQL Server or DB2)\r\nStrong knowledge and experience of SQL\r\nUnderstanding of Dimensional Models\r\nExperience with development and production support\r\nProfessional Skill Requirements :\r\n \r\nIt is currently our objective to assign our people to work near where they live.\r\nProven success in contributing to a team-oriented environment.\r\nProven ability to work creatively and analytically in a problem-solving environment.\r\nDesire to work in an information system environment\r\nExcellent communication (written and oral) and interpersonal skills\r\nThe sheer variety of work we do, and the experience it offers, provide an unbeatable platform from which to build a career.\r\nDice Id: 91081485\r\nPosition Id: 7873327\r\nPosted 3 days ago', 'dice.com', 'https&colon;&sol;&sol;www&period;dice&period;com&sol;job-detail&sol;87b79975-9ec5-49a4-b139-ed526e90845c', '2023-05-02 00:22:00', '2023-05-02 04:15:05', 0, 0, 'Dice - Робот в письме\r\nThanks for applying for the position of Talend Developer with 91081485 through Dice.'),
(48, '', 'Comprehensive Resources Inc', 'Neeta Khiani', '', 'https://www.dice.com/recruiter-profile?id=b73f49c2-af2c-429d-bcba-25d20fd0de6c', 'Talend ETL Developer', 'Job Description\r\nRole: Talend ETL Developer\r\nLocation: Remote    \r\nInterview: video interview     \r\n \r\nJob Description:    \r\n \r\n \r\nWe are looking for a Talend ETL Developer to join our team. The successful candidate will be responsible for designing and implementing data integration solutions that leverage Talend&#039;s core capabilities. As a Talend ETL Developer, you will work closely with business stakeholders, data analysts, and project managers to ensure that data integration solutions meet the organization&#039;s goals and priorities. \r\n \r\nResponsibilities: \r\nDesigning and implementing data integration solutions using Talend to extract, transform, and load data from various sources into target systems. \r\nDeveloping data quality routines using Talend to detect and correct data quality issues. \r\nCreating jobs and workflows to process big data using Talend&#039;s  \r\nDesigning and implementing cloud integration solutions using Talend to integrate data between on-premises and cloud-based systems. \r\nBuilding application integrations using Talend to integrate data with various applications, including CRM, ERP, and BI tools. \r\nCollaborating with other developers, data architects, and project managers to ensure that data integration solutions are aligned with the organization&#039;s goals and priorities. \r\nTesting and debugging data integration solutions to ensure they meet the organization&#039;s requirements and are error-free. \r\nDocumenting data integration solutions, including design documents, technical specifications, and user manuals. \r\n \r\nQualifications: \r\nBachelor&#039;s degree in Computer Science or related field. \r\n2+ years of experience as a Talend ETL Developer or similar role. \r\nStrong understanding of Talend&#039;s core capabilities, including data integration, data quality, big data, cloud integration, and application integration. \r\nExperience with Talend Data Integration, Data Fabric or Data Mapper \r\nKnowledge of SQL and database design principles. \r\nExperience with Data Warehousing using Star Schema, Dimensions, or Facts Tables \r\nExcellent communication skills and ability to work collaboratively with other developers, data architects, and project managers. \r\nStrong problem-solving skills and attention to detail. \r\n \r\nQuick responses are highly appreciated,\r\nReport this job\r\nDice Id: 10123046\r\nPosition Id: 140423\r\nPosted 18 days ago', 'Dice', 'https&colon;&sol;&sol;www&period;dice&period;com&sol;job-detail&sol;fab54857-9798-491a-9b02-6a86313e71ff', '2023-05-02 00:26:40', '2023-05-02 03:28:50', 0, 0, 'Dice - Робот в письме'),
(49, '$50 - $70 Contract: Corp-To-Corp, Independent, W2, 36 Month(s)', 'Staff Tech', '', '', '', '6803 - Talend Integration Developer', 'Job Description\r\nThe selected Personnel will provide TALEND development and support for the Data Integration Program. This Technical Analyst will work in conjunction with the IS Manager and other project managers to manage multiple projects, resources, and objectives required for the deployments of new applications and services at the data centers and at the individual superior courts. Managed resources include integration project managers, technical analysts, vendors, design engineers and court IT personnel. This Technical Analyst is also responsible for ensuring IS security compliance of all new data center services in collaboration with the information security officers.\r\n\r\n \r\n\r\nExperience developing data integration solutions using Talend ESB\r\nKnowledge and hands on experience with cloud applications, Azure, Java/J2EE, SQL, HTML, Java Script, XML, XLST, XSD, XPath, SOAP, FTP\r\nProvide subject matter expertise in preparation of documentation for projects including requirements, architecture and design documents, test plans, deployment, and operational guides.\r\nParticipation in technical assessments and reviews to validate the technical approach for systems integration for enterprise initiatives\r\nPerforming unit and integration testing for all developed applications, as well as providing technical and functional testing support\r\nAbility to troubleshoot complex system issues, provide root cause analysis, resolve issues and testing support of production issues.\r\nProvide production and operations support.\r\nProviding level of effort estimates for enhancement requests\r\nIdentifying items for application improvement\r\nWorking with a hosting provider to support a hosted system', 'dice.com', 'https&colon;&sol;&sol;www&period;dice&period;com&sol;job-detail&sol;bac4d21e-1753-40bb-ac08-199a10f3ea80', '2023-05-02 00:29:54', '2023-05-02 03:28:19', 0, 0, 'Dice - Робот в письме'),
