or similar role. \r\n\r\nStrong understanding of Talend&#039;s core capabilities, including data integration, data quality, big data, cloud integration, and application integration. \r\n\r\nExperience with Talend Data Integration, Data Fabric or Data Mapper \r\n\r\nKnowledge of SQL and database design principles. \r\n\r\nExperience with Data Warehousing using Star Schema, Dimensions, or Facts Tables \r\n\r\nExcellent communication skills and ability to work collaboratively with other developers, data architects, and project managers. \r\n\r\nStrong problem-solving skills and attention to detail. \r\n\r\nReport this job\r\nDice Id: 10113363\r\nPosition Id: 7848864\r\nPosted 20 days ago', 'dice.com', 'https&colon;&sol;&sol;www&period;dice&period;com&sol;job-detail&sol;c60c82ba-b60a-4466-a707-518c85a22037', '2023-05-02 01:03:32', '2023-05-02 03:27:59', 0, 0, 'Dice - Робот в письме'),
