(52, '!!! $50 - $60 Contract: W2, 12 Month(s)', 'SmartIMS Inc.', 'Praveen Narava SmartIMS Inc. Recruiter', '', 'https://www.dice.com/recruiter-profile?id=eb49fadc-0274-42c0-8013-4a1ce1a7d087', 'Senior Oracle PL/SQL Developer', 'Job Description\r\nSenior Oracle PL/SQL Developer\r\n100% Remote\r\nOracle Database. RAC\r\nReplica &ndash; sometables are replicated in another oracle database.\r\nOLTP &ndash; Online transactions.\r\nSQL, PL/SQL\r\nSchemas\r\nETL, DL Statements.  &ndash; Modify, data insertion, data etl.\r\nIncident management.\r\nSQL, PL/SQL, Incident management, Batch, schedule jobs &ndash; Autosys. / Stonebranch.\r\nSQL Stored procedures.\r\nInformation &ndash; ETL Jobs.\r\nSenior Oracle SQL PL/SQL consultant,\r\nSQL, PL/SQL\r\nSQL, PL/SQL, Incident management, Batch, schedule jobs &ndash; Autosys. / Stonebranch.\r\nSQL Stored procedures.\r\nAWS, Postgres SQL\r\nAWS Landscape', 'dice.com', 'https&colon;&sol;&sol;www&period;dice&period;com&sol;job-detail&sol;7e66c266-6b86-4398-8399-5cc89439c477', '2023-05-02 01:15:19', '2023-05-02 04:14:49', 0, 0, 'Dice - Робот в письме'),
(53, 'Contract: W2, Corp-To-Corp, Independent, 12 Month(s) Work from home', 'Conquest Consulting Austin, TX', '', '', 'https://www.dice.com/company-profile/122923dc-8b46-5a11-87e6-2f99abb38072', 'Database Architect / ETL Developer', 'https://www.dice.com/job-detail/403ad667-c840-41af-b076-366cdd5c3fb7?utm_source=Server&amp;%243p=e_sk&amp;%24deep_link=true&amp;utm_medium=Email&amp;utm_content=d_p_p_000_job_02&amp;utm_campaign=Job%2BAlerts&amp;_branch_match_id=1160963381942884353&amp;_branch_referrer=H4sIAAAAAAAAAyWNyw7CIBBFvwZ3tFgqNSbEaNSFWz%2BAUBgV5RUK9velmpnF3HOTM8%2Bc47RrW20UNDLGxhr%2Fbmnco66nkYOY3qt6aoAolornVGAhIZmH8dKKkix%2FLhZED6i71J3nufn5VHA1vsKINWRpbA09oVIzNmC17Qnu1%2FKORzIwTBlTWm8UvY8DopeSnZhCSQoQPd0gfSCtFuZAm%2BL42VXbD6jgM%2FjMtYh1CCGivhOk%2B5fSRWkenl%2FDiLrjwULK0xe%2Bh7G68gAAAA%3D%3D\r\nJob Description\r\nJob Title:         Database Architect / ETL Developer Location:         100% Remote &ndash; Austin, TX (TX Locals Highly Preferred) Duration:        12+ Months Contract\r\nUrgent Need of Database Architect/ETL Developer with at least min 9+ years of experience\r\nRESPONSIBILITIES:\r\nDesign, develop, and test ETL processes for the data warehouse.\r\nDevelop and document ETL processes to extract data from existing systems into the data warehouse.\r\nDocument the &ldquo;as-is&rdquo; schemas currently in use at TWC.\r\nPerform other analysis and documentation tasks as required to facilitate and support TWC&rsquo;s Enterprise Data Warehouse.\r\nYears\r\nYears\r\nSkills/Experience\r\n7 - 8\r\nHands-on experience with data warehouse development (relational and dimensional) and proven evidence to implement using databases like Oracle, SQL Server etc., preferably Oracle.\r\n7 - 8\r\nExperience with Oracle PL/SQL.\r\n6 - 8\r\nHands on experience with data modeling preferably in a data warehouse environment.\r\n3\r\nExperience with Informatica product suite in the Informatica cloud.\r\nStrong\r\nProven ability to work successfully with technical and non-technical groups and manage multiple responsibilities.\r\nStrong\r\nCommunication, analytical and interpersonal skills at all levels.\r\nStrong\r\nTechnical writing skills.\r\nPreferred:\r\nYears\r\nSkills/Experience\r\n6\r\nMore than one type of RDBMS (DB2, SQL Server, Oracle).\r\n4\r\nExperience in Public Sector delivery.\r\nExperience writing dynamic SQL.', 'dice.com', '', '2023-05-02 03:48:43', '2023-05-02 04:14:42', 0, 0, '');

